import React from "react";
import { Operadores } from "../Operadores";
import { Numeros } from "../Numeros";
import "./Botones.css";


function Botones({valueInput, setValueInput}) {
    return (
        <React.Fragment>
            <div className="contain-botones">
                <Numeros />
                <Operadores />
            </div>
        </React.Fragment>
    );
}

export { Botones };
